		"text": "\"5일에는 SK텔레콤이 음원 서비스업계 3위(가입자 85만 명)인 NHN벅스 인수를 검토하고 있다는 소문도 돌았다. SK텔레콤이 다음날 바로 부인하는 공시를 냈지만 여전히 가능성이 열려있다는 말도 나온다.\"",
